1	Rain	The rain pours down with a vengeance, each drop wetting the earth and entering into any uncovered crevices.\n\nA lady is in overly thin clothes and makeup that clearly does not hold up under the rain. With non-waterproof mascara dripping down her pale face, her once-beautiful features are forced to look horrible.\n\nYou wonder if you should help, offer to share your too-small umbrella but she just stands there unmoving like a forgotten statue except for the slight tremble of her shoulders- perhaps shes crying but you cant tell.\n\nYou keep on walking, you have things to do. Your boss has been on your neck for a complete project report and you have no time to sympathize with a stranger.\n\nA turn of the head ever-so-slightly and you see shes started walking. Albeit with feet that drag against the ground and a dull look in the eyes.\n\nShes walked further than you now, shes at the train station. The oncoming train isnt yours, you walk to buy a ticket.\n\nTheres a bit of commotion and you turn your head slightly, in your peripheral vision is the girl jumping onto the tracks and in front of the train.\n\nTheres blood, so much blood.\n\nTheres screaming and retching. Chaos abounds, you walk to get your ticket. Your boss needs the project report today.	The rain pours down with a vengeance, each drop wetting the earth and entering into any uncovered crevices.	rain	1	f	f	\N	2	0	0	{}	2022-08-19 11:55:47
