d by flames, was deemed a failure. The world believed that I who sought immortality had met a tragic demise, just another casualty of unchecked scientific ambition.\n\nWithin the depths of the wreckage, a dim flicker of consciousness remained. My thoughts, my very essence, survive within the intricate maze of the machine.\n\n_Save me!\n\nI exist now as a sentient mind, severed from the confines of my physical form, suspended in an eternal darkness of the ruined lab.\n\nDays blur into weeks, months into years, and the passing of time becomes an abstract concept.\n\n_Please help me!\n\nI am trapped in this abyss, in the dark realm of obscurity, devoid of the sensations of touch, sight, and sound.\n\nI float there in an eternal void.\n\nI have achieved my desire for immortality, yet it had become a prison of unimaginable torment.\n\nIn the solitude of the eternal darkness, my mind succumbs to madness.\n\n_Help!-\n\n_Help, if you can hear me please put me out of my misery.\n\nMy fractured mind conjures phantoms that taunt and torment me.\n\nReality blends with hallucinations, sanity slips through my grasp, I can no longer distinguish truth from illusion.\n\nIn the solitary darkness, I converse with phantoms conjured by my mind.\n\nThey tell me Im worthless. A fool for trying such a thing.\n\n_Am I such a fool?\n\nMy once-brilliant intellect falters, trapped in eternal isolation. I crave the sweet release of death, but death eludes me.\n\n_Please kill me.\n\n_Please- I beg of you. Find my lab and end me.\n\nDeath has turned its back on me.\n\nI am condemned to an existence suspended between life and death.\n\nAnd so, I, who sought to defy mortality, found myself ensnared in a purgatory of my own making.\n\nForever sentient, forever tormented.\n\nI haunt the ruins, a specter trapped between life and death, condemned to endure until the end of time itself.	I am in the empty corridors of an abandoned research facility, surrounded by silence. Once filled with the hum of scientific progress, now it lies in ruins.	machine	1	f	f	\N	4	0	0	{}	2023-05-30 18:25:37
13	Bleach	Do you want to end it all?\n\n_Drink bleach then!\n\nIt burns?\n\n_Of course it does.\n\nYouve lost your sense of taste and your tastebuds are burnt useless?\n\nThats all but expected. After all, you did drink bleach.\n\nNo one talks about the possibility of developing a sensitivity to the smell of bleach.\n\nHow it makes you physically ill smelling just the littlest bit of it.\n\nNo one talks about the gravity of your actions.\n\nYour mother finds you gasping, choking and foaming at the mouth.\n\nYoure taking anti-poison medication.\n\nShe is right beside your bed, praying you survive the night.\n\nYou can hear her vaguely.\n\nYou feel guilty.\n\nThere are multiple scars and a burn mark on your wrist but this is the first time youve dared cross deaths door so fearlessly.\n\nThe world doesnt need you, one less you is enough to make the world and your family a better place.\n\nYou thought this and it made you pick up the bottle.\n\nYou feel really ill, your stomach cramps up terribly.\n\nYou take a deep breath, theres a renewed energy in you now.\n\nYou have to survive the night, you must.	Do you want to end it all?	bleach	1	f	f	\N	1	0	0	{}	2023-06-24 19:34:50
14	Therapist	Youve come in again today for your session.\n\nYoure laying on my coffee colored couch telling me your fears, your thoughts.\n\nYoure afraid of the dark, you tell me.\n\nYou have no living family members and youre a workaholic.\n\nI write it down in my book, I write down anything I can find out about you.\n\nThis is fourth time this month youve come to see me.\n\nI indulge myself, seeing you is a treat to my senses.\n\nI dream of you, you are constantly on my mind. Thinking of you is the best feeling, having you in mind makes me realize just how close we are.\n\nI love you as if you are mine- you are mine.\n\nI've been checking on you for weeks now, watching your every move, studying your habits.\n\nI know your schedule and where you like to go.\n\nI have a room dedicated to you, filled with photos and keepsakes that I've collected.\n\nOne day, I will finally make my move.\n\nI will tell you that I love you and that I will never let you go.\n\nYou look frightened and try to run, but I grab you and hold you close.\n\nYou struggle and scream, but I don't let go. I hold you tighter and tighter, Ill take out my pocket knife and carve out your eyes. I want you to be in total darkness.\n\nI would feel a euphoric sense of satisfaction and joy.\n\nYou're finally mine, and no one can take you away from me.\n\nIve done the right thing, you should only depend on me.\n\n_Is it wrong?\n\nNo, I just can't help how I feel.	Youve come in again today for your session.	therapist	1	f	f	\N	2	0	0	{}	2023-06-24 19:37:03
15	Cave	Journal Entry - May 21, 2004_.\n\nFor the past five months I have been exploring the perimeter of the caves. They fascinate me. Im enticed to explore within.\n\nIn the depths of the cave a fallen god casts an imposing figure, surrounded by six statues in eternal reverence. They kneel facing it, heads bent to the earth. Their twisted forms bear witness to aeons of ancient devotion. Bleeding eyes fixed on its feet. The fallen god is a monolithic deity, a relic of another time long forgotten.\n\nAmong the bones scattered across the cavern floor, it lies in the center of the cave, tethered by vein-like wires pulsating with unearthly energy.\n\nIt has three heads, each displaying three different emotions, they have one thing in common. The eyes are gouged out.\n\nI am tempted to touch its feet.\n\n_I cant resist.\n\nDespite the warning whispers echoing in my mind, I succumb to temptation, reaching out to touch the gods cold, blood-streaked surface.\n\nThere is a vicious screeching in my ears.\n\n_Bow down, worship, pay homage.\n\nThe pain brings me to my knees\n\nBows my head to the earth.\n\nMy eyes bleed and so do my ears.\n\nVisions of hellfire and damnation flicker before my eyes, each scene more horrifying than the last.\n\nI see myself die in countless ways.\n\nMy essence is drained, consumed by the insatiable hunger of the fallen deity.\n\nIt drinks up my blood faster than I can bleed.\n\nMy body succumbs, petrifies, morphing into the seventh statue, the earth beneath me trembles in acknowledgment and I only feel it for a moment before everything goes dark.\n\n_End of entry.	Journal Entry - May 21, 2004_.	cave	1	f	f	\N	2	0	0	{}	2024-04-22 20:15:27
16	Nostalgia	Nostalgia is disgusting.\n\nIt is a slimy, writhing worm in your brain you cant reach. A parasite that gnaws at your sanity.\n\nYouve tried to grasp it but it moves around your brain and distorts your memory horribly. You remember people and miss them, their flaws fade in the warmth of fond memories. You forget their vile nature.\n\nIn your memories they are flawless, perfect.\n\nThe songs you listened to, the sunset you both witnessed, the jokes you shared-now it crawls around your memories like a dirty maggot distorting it.\n\nYouve begun to forget the bad memories.\n\nYou try so hard to remember but it squirms under your skin, burrows behind your eyes.\n\nYou must dig it out. Claw at your flesh.\n\nNostalgia whispers, urging you to send them a text, call, see how they are doing.\n\nIts been a while It says.\n\nNo. No? No!\n\nIts been trying for days to dig deeper into your brain. It has taken over your thoughts.\n\nIt hurts so badly. Its torment, excruciating pain.\n\nYou want to forget everything, purge your flesh.\n\nUse a hammer. Crush it.	Nostalgia is disgusting.	nostalgia	1	f	f	\N	1	0	0	{}	2024-07-12 22:05:24
